	[7602]={"Flawless Fel Essence",0,50,-1,{0,0},-61,7601,0,0,0,0,0,0,0,"Impsy in Felwood has asked that you bring him three Flawless Fel Essences originating from three distinct locations.\nThe Legashi Satyrs of Azshara hold the Flawless Fel Essence of their region. The Jaedenar Legionnaires of Jaedenar hold the Flawless Fel Essence of their region. The Felguard Sentries of the Blasted Lands hold the Flawless Fel Essence of their region.\nRecover the Flawless Fel Essences and return  to Impsy in Felwood."},
	[7603]={"Kroshius' Infernal Core",0,50,-1,{0,0},-61,7602,0,0,0,0,0,0,0,"Search Shatter Scar Vale in Felwood for the remains of Kroshius. When you locate the remains, use the Fel Fire near them and await Kroshius' return. When the infernal has awoken, slay him and take from his corpse Kroshius' Infernal Core.\nReturn Kroshius' Infernal Core to Niby the Almighty in Felwood."},
