	[7640]={"Exorcising Terrordale",0,60,-1,{72,250,47,75,69,75,930,75},-141,7639,0,0,0,0,0,0,0,"Use the Exorcism Censer to drive out the spirits that torment Terrordale.  When you have slain 25 Terrordale Spirits, return to Lord Grayson Shadowbreaker in the Cathedral District of Stormwind."},
	[7641]={"The Work of Grimand Elmore",0,60,-1,{0,0},-141,7640,0,0,0,0,0,0,0,"Speak with Grimand Elmore in Stormwind's Dwarven District."},
	[7642]={"Collection of Goods",0,60,-1,{47,250,69,75,469,75},-141,7641,0,0,0,0,0,0,0,"Bring 40 Runecloth, 6 Arcanite Bars, 10 Arthas' Tears, 5 Stratholme Holy Water vials, and 150 gold to Grimand Elmore in the Dwarven District of Stormwind."},
	[7643]={"Ancient Equine Spirit",0,60,-1,{0,0},-141,7642,0,0,0,0,0,0,0,"Acquire special horse feed used for feeding a spirit horse.  Merideth Carlson in Southshore apparently is the source for such food.\nTravel to the Dire Maul dungeon in Feralas and slay Tendris Warpwood.  Doing so will free the Ancient Equine Spirit.  Feed it the special horse feed, thereby soothing the spirit.  Finally, give it the Arcanite Barding so it may bless it."},
	[7644]={"Blessed Arcanite Barding",0,60,-1,{72,350},-141,7643,0,0,0,0,0,0,0,"Return with the Blessed Arcanite Barding to Lord Grayson Shadowbreaker in the Cathedral District of Stormwind."},
	[7645]={"Manna-Enriched Horse Feed",0,60,-1,{0,0},-141,-7643,0,0,0,0,0,0,0,"Retrieve 20 Enriched Manna Biscuits - the key ingredient in making Manna-Enriched Horse Feed - for Merideth Carlson at Southshore in the Hillsbrad Foothills.  The Argent Dawn is known as the sole purveyor of the biscuits.\nYou also need to give her 50 gold to soothe her ruffled sensibilities."},
	[7646]={"The Divination Scryer",0,60,-1,{72,75},-141,7644,0,0,0,0,0,0,0,"Bring an Azerothian Diamond and a Pristine Black Diamond to Lord Grayson Shadowbreaker in the Cathedral District of Stormwind."},
	[7647]={"Judgment and Redemption",0,60,-1,{72,500},-141,7646,0,0,0,0,0,0,0,"Use the Divination Scryer in the heart of the Great Ossuary's basement in the Scholomance.  Doing so will bring forth the spirits you must judge.  Defeating these spirits will summon forth Death Knight Darkreaver.  Defeat him and reclaim the lost soul of the fallen charger.\nGive the Charger's Redeemed Soul and the Blessed Enchanted Barding to Darkreaver's Fallen Charger."},
	[7648]={"Grimand's Finest Work",1,60,-1,{72,250},-141,7642,0,0,0,0,0,0,0,"Take the Arcanite Barding to Lord Grayson Shadowbreaker in Stormwind's Cathedral District for his inspection."},
